entity description:
  http://imce.jpl.nasa.gov/foundation/analysis/analysis: <p>The Analysis Ontology defines general concepts and properties for analyses (e.g., trade studies, driving requirements analysis, etc.). It provides a basis for specialization by domain experts.</p>
  analysis:Analysis: |-
    <p>An <code class='classname'>Analysis</code> is a product that captures or summarizes the results of
            an analysis activity and relates it to one or more other model elements. It may
            contain narrative prose directly or provide a reference to external products.</p><p>Driving requirements analyses, trade studies, and cost estimates are all examples of
                <code class='classname'>Analysis</code>.</p>
  analysis:Assumption: <p>An <code class='classname'>Assumption</code> is <code class='classname'>Characterization</code> that is taken to be true for the purpose of analysis.</p>
  analysis:Characterization: <p>A <code class='classname'>Characterization</code> is an element that provides a parametric or other characterization of another model element. The canonical example of a <code class='classname'>Characterization</code> is a set of name/value pairs, but other characterizations (e.g., classification) are possible.</p>
  analysis:CostEstimate: <p>A <code class='classname'>CostEstimate</code> is a kind of <code class='classname'>Analysis</code> that provides a cost estimate for the model elements it explains.</p>
  analysis:Criterion: |-
    <p>A <code class='classname'>Criterion</code> establishes a region for some
                <code class='classname'>Metric</code> that corresponds to success for some <code class='classname'>MeasuredElement</code>.</p><p>A <code class='classname'>Criterion</code> for the <code class='classname'>Metric</code>
            <span class='italic'>sample mass in kg</span> might be <span class='italic'>at
                least 10 kg</span>.</p>
  analysis:DrivingRequirementsAnalysis: <p>A <code class='classname'>DrivingRequirementsAnalysis</code> provides the rationale for designating a set of <code class='classname'>Requirement</code>s as <span class='emphasis'><em>driving</em></span>, and makes the designation via the <span class='property'>explains</span> property.</p>
  analysis:Fact: <p>A <code class='classname'>Fact</code> is an <code class='classname'>Assumption</code> that is true.</p>
  analysis:KeyRequirementsAnalysis: <p>A <code class='classname'>KeyRequirementsAnalysis</code> provides the rationale for designating a set of <code class='classname'>Requirement</code>s as <span class='emphasis'><em>key</em></span>, and makes the designation via the <span class='property'>explains</span> property.</p>
  analysis:Metric: |-
    <p>A <code class='classname'>Metric</code> establishes a method for quantifying achievement or
            satisfaction of one or more <code class='classname'>MeasuredElement</code>s. Note that the
            relationship is many to many: a given <code class='classname'>Metric</code> may jointly quantify
            multiple <code class='classname'>MeasuredElement</code>s. Likewise, a
                <code class='classname'>MeasuredElement</code> may be quantified by multiple
                <code class='classname'>Metric</code>s.</p><p>Appropriate <code class='classname'>Metric</code>s for the <code class='classname'>Objective</code>
            <span class='italic'>image Martian north polar region</span> might include data
            volumes at specified wavelength and resolution.</p>
  analysis:Quantity: |-
    <p>A <code class='classname'>Quantity</code> attaches a value for some
                <code class='classname'>Metric</code> to one or more <code class='classname'>SpecifiedElement</code>s.
            That is, it evaluates some aspect of a design by assigning a definite value to a specific
                <code class='classname'>Metric</code>.</p>
  analysis:QuantityValue: <p>A <code class='classname'>QuantityValue</code> assigns a value to a <code class='classname'>Quantity</code>.</p>
  analysis:TradeStudy: <p>A <code class='classname'>TradeStudy</code> explains some set of model elements and their properties through comparison with alternatives.</p>
  analysis:analyzes: <p>An <code class='classname'>Analysis</code> <em class='replaceable'><code>a</code></em> <span class='property'>analyzes</span> some <code class='classname'>IdentifiedElement</code> <em class='replaceable'><code>e</code></em> if and only if <em class='replaceable'><code>a</code></em> considers or otherwise takes account of <em class='replaceable'><code>e</code></em>.</p>
  analysis:characterizes: |-
    <p>A
    <code class='classname'>Characterization</code>
    <em class='replaceable'><code>c</code></em>
    <span class='property'>characterizes</span>
    a
    <code class='classname'>CharacterizedElement</code>
    <em class='replaceable'><code>e</code></em>
    if and only if
    <em class='replaceable'><code>c</code></em>
    describes, delimits, or restricts
    <em class='replaceable'><code>e</code></em>.</p>
  analysis:explains: <p>An <code class='classname'>Analysis</code> <em class='replaceable'><code>a</code></em> <span class='property'>explains</span> some <code class='classname'>SpecifiedElement</code> <em class='replaceable'><code>e</code></em> if and only if <em class='replaceable'><code>a</code></em> provides a rationale or justification for some design aspect of <em class='replaceable'><code>e</code></em>.</p>
  analysis:hasCriterion: |-
    <p>A <code class='classname'>Metric</code>
            <em class='replaceable'><code>m</code></em> <span class='property'>hasCriterion</span> some
            <code class='classname'>Criterion</code>
            <em class='replaceable'><code>c</code></em> if and only if <em class='replaceable'><code>c</code></em> establishes a region of success for <em class='replaceable'><code>m</code></em>.</p>
  analysis:hasMetric: |-
    <p>An <code class='classname'>Quantification</code>
            <em class='replaceable'><code>q</code></em> <span class='property'>hasMetric</span> some
                <code class='classname'>Metric</code>
            <em class='replaceable'><code>m</code></em> if and only if <em class='replaceable'><code>q</code></em> assigns a value to
                <em class='replaceable'><code>m</code></em> for some aspect of a design.</p>
  analysis:isCharacterizedBy: <p>See <span class='property'>characterizes</span>.</p>
  analysis:isExplainedBy: <p>See <span class='property'>explains</span>.</p>
  analysis:isLimitedBy: <p>See <span class='property'>limits</span>.</p>
  analysis:isValidatedBy: <p>See <span class='property'>validates</span>.</p>
  analysis:measures: |-
    <p>A <code class='classname'>Criterion</code>
            <em class='replaceable'><code>c</code></em>
            <span class='property'>measures</span> some <code class='classname'>MeasuredElement</code>
            <em class='replaceable'><code>e</code></em> if and only if <em class='replaceable'><code>c</code></em> defines a region for some <code class='classname'>Metric</code> that corresponds to success
    for <em class='replaceable'><code>e</code></em>.</p>
  analysis:quantifies: |-
    <p>A <code class='classname'>Quantification</code>
            <em class='replaceable'><code>q</code></em>
            <span class='property'>quantifies</span> some <code class='classname'>SpecifiedElement</code>
            <em class='replaceable'><code>e</code></em> if and only if <em class='replaceable'><code>q</code></em> assigns a value to
            some <code class='classname'>Metric</code>  for <em class='replaceable'><code>e</code></em>.</p>
  analysis:validates: <p>An <code class='classname'>Analysis</code> <em class='replaceable'><code>a</code></em> <span class='property'>validates</span> some <code class='classname'>SpecifiedElement</code> <em class='replaceable'><code>e</code></em> if and only if <em class='replaceable'><code>a</code></em> provides a definitive, determinative explanation for some design aspect of <em class='replaceable'><code>e</code></em>.</p>
  http://imce.jpl.nasa.gov/foundation/base/base: <p>The Base Ontology defines foundation concepts that are common to multiple specialized ontologies.</p>
  base:Package: <p>A <code class='classname'>Package</code> groups an arbitrary collection of model elements.</p>
  base:aggregates: <p>An <code class='classname'>AggregatedElement</code> <em class='replaceable'><code>e</code></em> <span class='property'>aggregates</span> zero or more elements of compatible type if and only if <em class='replaceable'><code>e</code></em> references or subsumes  those other elements.</p>
  base:contains: |-
    <p>A
    <code class='classname'>Container</code>
    <em class='replaceable'><code>c<sub>1</sub></code></em>
    <span class='property'>contains</span>
    another
    <code class='classname'>ContainedElement</code>
    <em class='replaceable'><code>e<sub>2</sub></code></em>
    if and only if
    <code class='classname'>ContainedElement</code>
    <em class='replaceable'><code>e<sub>2</sub></code></em>
    is incorporated within or otherwise a part of
    <code class='classname'>Container</code>
    <em class='replaceable'><code>c<sub>1</sub></code></em>
    and no (directly) any other <code class='classname'>Container</code>.</p>
  base:hasAlternateName: <p>The <span class='property'>hasAlternateName</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or more alternate names. Alternate names need not be unique.</p>
  base:hasCanonicalName: <p>The <span class='property'>hasCanonicalName</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or one canonical names. Canonical names need not be unique.</p>
  base:hasContainmentIndex: <p>The <span class='property'>hasContainmentIndex</span> indicates the unique position of a <code class='classname'>ContainedElement</code> in a tree of <span class='property'>contains</span> relationships.</p>
  base:hasDescription: <p>The <span class='property'>hasDescription</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or one text descriptions.</p>
  base:hasIdentifier: <p>The <span class='property'>hasIdentifier</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or more identifiers. An identifier should belong uniquely to an <code class='classname'>IdentifiedElement</code> in some context.</p>
  base:hasIndexEntry: <p>The <span class='property'>hasIndexEntry</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or one terms under which it would be indexed in a document.</p>
  base:hasShortName: <p>The <span class='property'>hasShortName</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or more short names. Short names need not be unique.</p>
  base:hasSortKey: <p>The <span class='property'>hasSortKey</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or one string-valued keys that may be used to establish its order in a sorted collection.</p>
  base:hasUuid: <p>The <span class='property'>hasUuid</span> property relates an <code class='classname'>IdentifiedElement</code> to zero or one Universally Unique Identifier as defined by RFC 4122, expressed as a string.</p>
  base:isAggregatedIn: <p>See <span class='property'>aggregates</span>.</p>
  base:isContainedIn: <p>The <span class='property'>isContainedIn</span> property is used to relate classes that can be composed into a strict hierarchy. An element <span class='property'>isContainedIn</span> at most one parent element.</p>
  http://imce.jpl.nasa.gov/foundation/behavior/behavior: '<p>The Behavior Ontology
    defines concepts and properties for describing behavior. The complete documentation
    for this ontology is hosted on the MBSE CoP website at: https://mbse.jpl.nasa.gov/confluence/display/IMCECOP/Behavior+Pattern+-+V1.0.</p>'
  behavior:AttributeAutomatonConstraint: |-
    <p>An <code class='classname'>AttributeAutomatonConstraint</code> can be used to specify the <code class='classname'>Codomain</code> of a discrete <code class='classname'>StateVariable</code> using <code class='classname'>AutomatonState</code>s.
    It can also represents behavior constraints that are more amenable to an automata form.</p>
  behavior:AutomatonRegion: <p>An <code class='classname'>AutomatonRegion</code> groups <code class='classname'>AutomatonState</code>s of an <code class='classname'>AttributeAutomatonConstraint</code>.</p>
  behavior:AutomatonState: <p>An <code class='classname'>AutomatonState</code> represents a state of a <code class='classname'>StateVariable</code>, i.e., a possible value of the quantity of a <code class='classname'>BehavingElement</code>, and in effect an element of the <code class='classname'>Codomain</code> of a <code class='classname'>StateVariable</code>.</p>
  behavior:Codomain: <p>A <code class='classname'>Codomain</code> is the set of possible values of a quantity represented by a <code class='classname'>StateVariable</code>.</p>
  behavior:CodomainValueType: <p>A <code class='classname'>CodomainValueType</code> defines the type of the quantity the associated <code class='classname'>Codomain</code> represents.</p>
  behavior:ElementBehaviorCharacterization: <p>An <code class='classname'>ElementBehaviorCharacterization</code> groups <code class='classname'>ElementBehaviorConstraint</code>s through the <span class='property'>hasConstraint</span>. It also <span class='property'>references</span> <code class='classname'>PropertyGroup</code>s of which the <code class='classname'>Attributes</code>s are of interest in the scope of the <code class='classname'>ElementBehaviorConstraint</code>s.</p>
  behavior:ElementBehaviorConstraint: |-
    <p><code class='classname'>ElementBehaviorConstraint</code> specifies how the dynamic state of a <code class='classname'>BehavingElement</code> is allowed to evolve in time.
    It is expressed by <span class='property'>constrain</span>ing <code class='classname'>StateVariableConstraintParticipant</code>s and <span class='property'>us</span>ing <code class='classname'>ParameterConstraintParticipant</code>s.</p>
  behavior:Interaction: |-
    <p>An <code class='classname'>Interaction</code> is a link that <span class='property'>joins</span> <code class='classname'>InteractionTerminal</code>s, representing the context of the interaction among the associated <code class='classname'>BehavingElement</code>s.
    An <code class='classname'>Interaction</code> groups <code class='classname'>InteractionBehaviorConstraint</code>s through the <span class='property'>hasConstraint</span>.</p>
  behavior:InteractionBehaviorConstraint: |-
    <p><code class='classname'>InteractionBehaviorConstraint</code> specifies how different <code class='classname'>BehavingElement</code>s interact with one another.
    It is expressed by <span class='property'>constrain</span>ing <code class='classname'>StateVariableConstraintParticipant</code>s and <span class='property'>us</span>ing <code class='classname'>ParameterConstraintParticipant</code>s.</p>
  behavior:InteractionTerminal: <p>An <code class='classname'>InteractionTerminal</code> is a construct that acts as a filter for selecting the <code class='classname'>StateVariable</code>s and <code class='classname'>Parameter</code>s of one <code class='classname'>BehavingElement</code> involved in an interaction with other <code class='classname'>BehavingElement</code>s.</p>
  behavior:Parameter: <p>A <code class='classname'>Parameter</code>is a quantity of a <code class='classname'>BehavingElement</code> that does not dynamically change in time.</p>
  behavior:ParameterConstraintParticipant: |-
    <p>A <code class='classname'>ParameterConstraintParticipant</code> is a property <span class='property'>use</span>d by an <code class='classname'>AttributeConstraint</code> (<code class='classname'>ElementBehaviorConstraint</code> or <code class='classname'>InteractionBehaviorConstraint</code>).
    When <span class='property'>use</span>d by an <code class='classname'>ElementBehaviorConstraint</code>, it <span class='property'>playsRoleOf</span> a <code class='classname'>Parameter</code>, and when <span class='property'>use</span>d by an <code class='classname'>InteractionBehaviorConstraint</code>, it <span class='property'>playsRoleOf</span> a <code class='classname'>ParameterSurrogate</code>.</p>
  behavior:ParameterSurrogate: <p>A <code class='classname'>ParameterSurrogate</code> is a property of an <code class='classname'>InteractionTerminal</code> and <span class='property'>exposes</span> a <code class='classname'>Parameter</code> of the <code class='classname'>PropertyGroup</code> its <code class='classname'>InteractionTerminal</code> <span class='property'>presents</span>.</p>
  behavior:ParameterValueType: <p>A <code class='classname'>ParameterValueType</code> defines the type of the quantity the associated <code class='classname'>Parameter</code> represents.</p>
  behavior:PropertyGroup: <p>An <code class='classname'>PropertyGroup</code> is a construct that acts as a grouping mechanism for <code class='classname'>StateVariale</code>s or <code class='classname'>Parameter</code>s. The meaning of the grouping is left to the modeler's intent.</p>
  behavior:StateVariable: |-
    <p>A <code class='classname'>StateVariable</code> is a variable that represents a particular quantity (as per ISO-80000) of a <code class='classname'>BeahvingElement</code> that changes with time.
    It is the Cartesian product of its <code class='classname'>TimeDomain</code> and <code class='classname'>Codomain</code>.</p>
  behavior:StateVariableConstraintParticipant: |-
    <p>A <code class='classname'>StateVariableConstraintParticipant</code> is a property <span class='property'>constrain</span>ed by an <code class='classname'>AttributeConstraint</code> (<code class='classname'>ElementBehaviorConstraint</code> or <code class='classname'>InteractionBehaviorConstraint</code>).
    When <span class='property'>constrain</span>ed by an <code class='classname'>ElementBehaviorConstraint</code>, it <span class='property'>playsRoleOf</span> a <code class='classname'>StateVariable</code>, and when <span class='property'>constrain</span>ed by an <code class='classname'>InteractionBehaviorConstraint</code>, it <span class='property'>playsRoleOf</span> a <code class='classname'>StateVariableSurrogate</code>.</p>
  behavior:StateVariableSurrogate: <p>A <code class='classname'>StateVariableSurrogate</code> is a property of an <code class='classname'>InteractionTerminal</code> and <span class='property'>exposes</span> a <code class='classname'>StateVariable</code> of the <code class='classname'>PropertyGroup</code> its <code class='classname'>InteractionTerminal</code> <span class='property'>presents</span>.</p>
  behavior:StateVariableValueType: <p>A <code class='classname'>StateVariableValueType</code> defines the type of the its associated <code class='classname'>StateVariable</code>.</p>
  behavior:TimeDomain: <p>A <code class='classname'>TimeDomain</code> is the set of possible times that belong to a particular <code class='classname'>StateVariable</code>.</p>
  behavior:TimeDomainValueType: <p>A <code class='classname'>TimeDomainValueType</code> defines the type of the time quantity the associated <code class='classname'>TimeDomain</code> represents.</p>
  behavior:exposes: <p>A <code class='classname'>PropertySurrogate</code> <em class='replaceable'><code>s</code></em> <span class='property'>exposes</span> a <code class='classname'>Property</code> <em class='replaceable'><code>p</code></em> if an only if <em class='replaceable'><code>s</code></em> represents <em class='replaceable'><code>p</code></em> in an <code class='classname'>Interaction</code>.</p>
  behavior:joins: <p>An <code class='classname'>Interaction</code> <em class='replaceable'><code>i</code></em> <span class='property'>joins</span> an <code class='classname'>AttributeGroup</code> <em class='replaceable'><code>a</code></em> if an only if the <code class='classname'>BehavingElement</code>s associated with <em class='replaceable'><code>a</code></em> are involved in the interaction represented by <em class='replaceable'><code>i</code></em>.</p>
  behavior:playsRoleOf: <p>An <code class='classname'>AttributeConstraintParticipant</code> <em class='replaceable'><code>p</code></em> <span class='property'>playsRoleOf</span> an <code class='classname'>Attribute</code> <em class='replaceable'><code>a</code></em> if an only if it represents <em class='replaceable'><code>a</code></em> in an <code class='classname'>AttributeConstraint</code>.</p>
  behavior:presents: <p>A <code class='classname'>PropertyGroup</code> <em class='replaceable'><code>g</code></em> <span class='property'>presents</span> an <code class='classname'>InteractionTerminal</code> <em class='replaceable'><code>i</code></em> if and only if <code class='classname'>Attribute</code>s of <em class='replaceable'><code>g</code></em> are directly influenced by <code class='classname'>Attribute</code>s of other <code class='classname'>BehavingElement</code>s.</p>
  behavior:references: <p>An <code class='classname'>ElementBehaviorCharacterization</code> <em class='replaceable'><code>c</code></em> <span class='property'>references</span> a <code class='classname'>PropertyGroup</code> <em class='replaceable'><code>g</code></em> if an only if <code class='classname'>ElementBehaviorConstraint</code>s of <em class='replaceable'><code>c</code></em> constrain or use <code class='classname'>Propert</code>ies of <em class='replaceable'><code>g</code></em>.</p>
  http://imce.jpl.nasa.gov/foundation/mission/mission: <p>The Mission Ontology defines concepts and properties for describing missions in terms of their objectives, their constituent components, the functions those components perform, and the requirements that specify them.</p>
  mission:Component: |-
    <p>A <code class='classname'>Component</code> is a <code class='classname'>PerformingElement</code> that is not a <code class='classname'>Mission</code>. Example
                <code class='classname'>Component</code>s include launch vehicle, spacecraft, telecommunication subsystem,
            flight software, attitude control software, and mission operations team.</p>
  mission:Environment: |-
    <p>An <code class='classname'>Environment</code> corresponds to a set of conditions in which a <code class='classname'>Component</code> must <span class='property'>perform</span> its <code class='classname'>Function</code>s.
    Example environments include low earth orbit, trans-Jupiter cruise, and Martian north polar surface.</p>
  mission:Flow: <p>A <code class='classname'>Flow</code> represents a non-discrete transfer of matter or energy between <code class='classname'>Function</code>s. Examples of <code class='classname'>Flow</code> include electrical power, propellant, and heat.</p>
  mission:Function: |-
    <p>A <code class='classname'>Function</code> is an operation or activity performed by a
                <code class='classname'>Component</code> in the context of executing a
                <code class='classname'>Mission</code>. Every <code class='classname'>Function</code> is a
                <code class='classname'>SpecifiedElement</code>, which implies that a
                <code class='classname'>Requirement</code> can <span class='property'>specify</span> a
                <code class='classname'>Function</code>. <code class='classname'>Function</code>s, therefore,
            represent intended <code class='classname'>Component</code> behavior. Example
                <code class='classname'>Function</code>s include <span class='italic'>search for life on
                Mars</span>, <span class='italic'>insert into Martian orbit</span>, and
                <span class='italic'>send instrument telemetry packet</span>.</p><p><code class='classname'>Function</code>s may <span class='property'>emit</span> or
                <span class='property'>ingest</span>
            <code class='classname'>Flow</code>s representing non-discrete exchanges of matter or energy.
                <code class='classname'>Function</code>s may <span class='property'>send</span> or
                <span class='property'>receive</span>
            <code class='classname'>Item</code>s representing discrete exchanges of matter or
            information.</p>
  mission:Interchange: <p>An <code class='classname'>Interchange</code> represents the intended joint behavior of a pair of <code class='classname'>PerformingElement</code>s. It indicates that a <code class='classname'>Flow</code> or <code class='classname'>Item</code> may be sent or emitted by one <code class='classname'>PerformingElement</code> and received or ingested by another.</p>
  mission:Interface: |-
    <p>An <code class='classname'>Interface</code> represents a set of mechanical, electrical, signal, or
            other properties that describe some aspect of a <code class='classname'>Component</code>'s
            connection to or interaction with another <code class='classname'>Component</code>.</p><p>It is important to distinguish between a <code class='classname'>Component</code>, which is a
            discrete thing, and an <code class='classname'>Interface</code>, which is a collection of
            properties. In the formulation phase, for example, we might model the launch vehicle and the
            spacecraft as <code class='classname'>Component</code>s. The properties that describe how the
            spacecraft is designed to attach to the launch vehicle would be captured in one
                <code class='classname'>Interface</code> (and associated with the spacecraft using the
                <span class='property'>presents</span> property). The properties that describe how the launch
            vehicle is designed or configured to attach to the spacecraft would be captured in another
                <code class='classname'>Interface</code>. The fact that two (or more) interfaces mate with each other is conveyed the existence of an <code class='classname'>Junction</code> that <span class='property'>joins</span> the <code class='classname'>Interface</code>s.</p><p>This method of modeling interfaces allows us to capture the asymmetric aspect of
            producer/consumer relationships, as well as providing a convenient method for associating
            the sets of properties and characterize the interconnection of any pair of
                <code class='classname'>Component</code>s so that they can be analyzed for consistency.</p>
  mission:Junction: |-
    <p>An <code class='classname'>Junction</code> represents a set of mechanical, electrical, signal, or
            other properties that are common to a set of mutually connected <code class='classname'>Interface</code>s.</p>
  mission:MaterialItem: <p>A <code class='classname'>MaterialItem</code> is a discrete unit of material exchanged between two <code class='classname'>Function</code>s. Example <code class='classname'>MaterialItem</code>s include rock hammer and soil sample.</p>
  mission:Message: <p>A <code class='classname'>Message</code> is a discrete unit of information exchanged between two <code class='classname'>Function</code>s. Example <code class='classname'>Message</code>s include command, command response, and file contents.</p>
  mission:Mission: |-
    <p>
    A <code class='classname'>Mission</code> is a <code class='classname'>PerformingElement</code> that <span class='property'>pursue</span>s <code class='classname'>Objectives</code>.
    </p><p>
    A <code class='classname'>Mission</code> may
    <span class='property'>contain</span>
    <code class='classname'>Component</code>s, but the preferred relationship is that a
    <code class='classname'>Mission</code>
    <span class='property'>deploy</span>s its systems (which are <code class='classname'>Component</code>s). This convention allows for a <code class='classname'>Mission</code> to be associated with shared or external <code class='classname'>Component</code>s that it does not strictly <span class='property'>contain</span>.
    </p>
  mission:Objective: |-
    <p>An <code class='classname'>Objective</code> represents a specific interest that one or more
            stakeholders have in the successful execution of a mission. Example
                <code class='classname'>Objective</code>s include characterize the extent of the Europan ocean
            and its relation to the deeper interior, characterize the Europan ice shell and any
            subsurface water, including their heterogeneity, and the nature of surface-ice-ocean
            exchange, and determine global Europan surface compositions and chemistry, especially as
            related to habitability.</p><p><code class='classname'>Objective</code>s differ from <code class='classname'>Requirement</code>s in that
            they are not the result of negotiated agreement between customer and supplier, they need not
            be mutually consistent, and a <code class='classname'>Mission</code>
            <span class='property'>pursues</span> but need not completely achieve all its
                <code class='classname'>Objective</code>s. In a sense, the set of
                <code class='classname'>Requirement</code>s for a <code class='classname'>Mission</code> represents the
            minimum acceptable achievement of <code class='classname'>Objectives</code> for a given cost,
            schedule, and risk.</p>
  mission:Requirement: |-
    <p>A <code class='classname'>Requirement</code> specifies an assertion about a
                <code class='classname'>SpecifiedElement</code> (<code class='classname'>Component</code>,
                <code class='classname'>Function</code>, or <code class='classname'>Interface</code>) that must be true
            for every acceptable realization of that element.</p><p>By definition, a <code class='classname'>Requirement</code> that specifies a
                <code class='classname'>Function</code> is a <span class='italic'>functional
                requirement</span>. A <code class='classname'>Requirement</code> that specifies an
                <code class='classname'>Interface</code> is an <span class='italic'>interface
                requirement</span>.  A <code class='classname'>Requirement</code> that specifies a
                <code class='classname'>Component</code> is a <span class='italic'>component
                requirement</span>.</p>
  mission:deploys: "<p>A\na <code class='classname'>Mission</code> <em class='replaceable'><code>m</code></em>\
    \ \n<span class='property'>deploys</span>\n<code class='classname'>Component</code>\
    \ <em class='replaceable'><code>c</code></em>\nif and only if <em class='replaceable'><code>m</code></em>\
    \ exploits or utilizes <em class='replaceable'><code>c</code></em> in pursuit\
    \ of  <code class='classname'>Objective</code>s. Note that a given <code class='classname'>Mission</code>\
    \ may not <span class='emphasis'><em>own</em></span> all the <code class='classname'>Component</code>s\
    \ it <span class='property'>deploys</span>; some <code class='classname'>Component</code>s\
    \ (e.g., ground system assets) may be shared with multiple missions.</p>"
  mission:emits: |-
    <p>A <code class='classname'>Function</code> <em class='replaceable'><code>F</code></em>
    <span class='property'>emits</span>
    a <code class='classname'>Flow</code> <em class='replaceable'><code>f</code></em>
    if and only if <em class='replaceable'><code>F</code></em> is the source of <em class='replaceable'><code>f</code></em>.</p>
  mission:hasRationale: <p>A <span class='property'>rationale</span> explains why a <code class='classname'>Requirement</code> exists and why it <span class='property'>specifies</span> what it does.</p>
  mission:induces: |-
    <p>A
    <code class='classname'>Component</code>
    <em class='replaceable'><code>c</code></em>
    <span class='property'>induces</span>
    an
    <code class='classname'>Environment</code>
    <em class='replaceable'><code>e</code></em>
    if and only if
    <em class='replaceable'><code>c</code></em>
    generates or contributes to the conditions described in
    <em class='replaceable'><code>e</code></em>.</p>
  mission:influences: |-
    <p>An
    <code class='classname'>Environment</code>
    <em class='replaceable'><code>e</code></em>
    <span class='property'>influences</span>
    a
    <code class='classname'>Component</code>
    <em class='replaceable'><code>c</code></em>
    if and only if
    <em class='replaceable'><code>c</code></em>
    is subject to the conditions that define
    <em class='replaceable'><code>e</code></em>.</p>
  mission:ingests: |-
    <p>An
    <code class='classname'>Function</code>
    <em class='replaceable'><code>F</code></em>
    <span class='property'>ingests</span>
    a
    <code class='classname'>Flow</code>
    <em class='replaceable'><code>f</code></em>
    if and only if
    <em class='replaceable'><code>F</code></em>
    consumes or is otherwise the recipient of
    <em class='replaceable'><code>f</code></em>.</p>
  mission:invokes: "<p>A\n<code class='classname'>Function</code>\n<em class='replaceable'><code>f<sub>1</sub></code></em>\n\
    <span class='property'>invokes</span>\na\n<code class='classname'>Function</code>\n\
    <em class='replaceable'><code>f<sub>2</sub></code></em>\nif and only if execution\
    \ of \n<em class='replaceable'><code>f<sub>1</sub></code></em>\nmay directly cause\
    \ execution of\n<em class='replaceable'><code>f<sub>2</sub></code></em>.</p>"
  mission:performs: |-
    <p>A
    <code class='classname'>Component</code>
    <em class='replaceable'><code>c</code></em>
    <span class='property'>performs</span>
    a
    <code class='classname'>Function</code>
    <em class='replaceable'><code>f</code></em>
    if and only if
    <em class='replaceable'><code>c</code></em>
    has the sole responsibility for execution of
    <em class='replaceable'><code>f</code></em>.</p>
  mission:presents: <p>A <code class='classname'>Component</code> <em class='replaceable'><code>c</code></em> <span class='property'>presents</span> an <code class='classname'>Interface</code> <em class='replaceable'><code>i</code></em> if and only if <em class='replaceable'><code>c</code></em> has a direct electrical, mechanical, or logical connection to the outside via <em class='replaceable'><code>i</code></em>. Exactly one <code class='classname'>Component</code> <span class='property'>presents</span> each <code class='classname'>Interface</code>.</p>
  mission:pursues: <p>A <code class='classname'>Mission</code> <em class='replaceable'><code>m</code></em> <span class='property'>pursues</span> an <code class='classname'>Objective</code> <em class='replaceable'><code>o</code></em> if and only if the successful execution of <em class='replaceable'><code>m</code></em> results in at least partial achievement of <em class='replaceable'><code>o</code></em>.</p>
  mission:receives: |-
    <p>A <code class='classname'>Function</code> <em class='replaceable'><code>F</code></em>
    <span class='property'>receives</span>
    an <code class='classname'>Item</code> <em class='replaceable'><code>i</code></em>
    if and only if <em class='replaceable'><code>F</code></em> consumes <em class='replaceable'><code>i</code></em>.</p>
  mission:refines: <p>A <code class='classname'>Requirement</code> <em class='replaceable'><code>l</code></em> <span class='property'>refines</span> a <code class='classname'>Requirement</code> <em class='replaceable'><code>h</code></em> if and only if satisfaction of <em class='replaceable'><code>l</code></em> implies partial satisfaction of <em class='replaceable'><code>h</code></em>.</p>
  mission:sends: |-
    <p>A <code class='classname'>Function</code> <em class='replaceable'><code>F</code></em>
    <span class='property'>sends</span>
    an <code class='classname'>Item</code> <em class='replaceable'><code>i</code></em>
    if and only if <em class='replaceable'><code>F</code></em> is the source for <em class='replaceable'><code>i</code></em>.</p>
  mission:specifies: <p>A <code class='classname'>Requirement</code> <em class='replaceable'><code>r</code></em> <span class='property'>specifies</span> a element <em class='replaceable'><code>e</code></em> if and only if the properties of <em class='replaceable'><code>e</code></em> are bound by <em class='replaceable'><code>r</code></em>.</p>
  mission:transfersIn: |-
    <p>An <code class='classname'>Interface</code>
    <em class='replaceable'><code>i</code></em>
    <span class='property'>transfersOut</span>
    a
    <code class='classname'>TraversingElement</code>
    <em class='replaceable'><code>e</code></em>
    if and only if
    <em class='replaceable'><code>i</code></em>
    is the access point by which
    <em class='replaceable'><code>e</code></em>
    leaves a <code class='classname'>Component</code>
    that
    <span class='property'>presents</span>
    <em class='replaceable'><code>i</code></em>.</p>
  mission:transfersOut: |-
    <p>An <code class='classname'>Interface</code>
    <em class='replaceable'><code>i</code></em>
    <span class='property'>transfersOut</span>
    a
    <code class='classname'>TraversingElement</code>
    <em class='replaceable'><code>e</code></em>
    if and only if
    <em class='replaceable'><code>i</code></em>
    is the access point by which
    <em class='replaceable'><code>e</code></em>
    leaves a <code class='classname'>Component</code>
    that
    <span class='property'>presents</span>
    <em class='replaceable'><code>i</code></em>.</p>
  mission:traverses: |-
    <p>A <code class='classname'>TraversingElement</code> <em class='replaceable'><code>e</code></em>
    <span class='property'>traverses</span>
    an <code class='classname'>Junction</code> <em class='replaceable'><code>j</code></em>
    if and only if <em class='replaceable'><code>j</code></em> provides a medium or channel for the transfer of <em class='replaceable'><code>e</code></em>.</p>
  http://imce.jpl.nasa.gov/foundation/project/project: <p>The Project Ontology defines concepts and properties for describing a project in terms of its stakeholders, concerns, work breakdown, and deliverables. It provides a basis for specialization by domain experts.</p>
  project:Authority: |-
    <p>An <code class='classname'>Authority</code> is any entity that asserts a fact in a model. Example <code class='classname'>Authority</code>s include
    <code class='classname'>Program</code>,
    <code class='classname'>Project</code>, and
    <code class='classname'>WorkPackage</code>. (The association of an <code class='classname'>Authority</code> with its asserted facts requires mechanisms outside the vocabulary of OWL itself, e.g., named graphs. For this reason, there is no object property <span class='property'>authorizes</span>. Authorization is conveyed by the organization of statements in a repository.)</p>
  project:Concern: <p>A <code class='classname'>Concern</code> represents a specific interest that one or more stakeholders have in the successful completion of a <code class='classname'>Project</code> or <code class='classname'>Program</code> and its <code class='classname'>Mission</code>s. </p>
  project:Deliverable: <p>A <code class='classname'>Deliverable</code> is the result of successful execution of a <code class='classname'>Process</code>. It may be an input to or prerequisite for another <code class='classname'>Process</code>.</p>
  project:DevelopmentState: |-
    <p>A <code class='classname'>DevelopmentState</code> is a kind of
    <code class='classname'>Deliverable</code> that represents a defined condition for a <code class='classname'>DevelopedElement</code>. <code class='classname'>DevelopmentState</code>s may be unique to the <code class='classname'>DevelopedElement</code>; example <code class='classname'>DevelopmentState</code>s for a <code class='classname'>Product</code> include Preliminary, Draft, and Final.</p>
  project:Facility: <p>A <code class='classname'>Facility</code> is any asset (e.g., laboratory, assembly facility, test facility, etc.) whose <code class='classname'>DevelopmentState</code> may be a <code class='classname'>Deliverable</code> for a project process.</p>
  project:Interchange: <p>An <code class='classname'>Interchange</code> represents the intended joint behavior of a pair of <code class='classname'>Process</code>es. It indicates that a <code class='classname'>Deliverable</code> may be delivered by one <code class='classname'>Process</code> and received by the other <code class='classname'>Process</code>.</p>
  project:Organization: <p>An <code class='classname'>Organization</code> is any entity that <span class='property'>isResponsibleFor</span> a <code class='classname'>Authority</code>.</p>
  project:Person: <p>A <code class='classname'>Person</code> corresponds to an individual named person. A <code class='classname'>Person</code> <span class='property'>belongsTo</span> zero or more <code class='classname'>Organization</code>s.</p>
  project:Policy: <p>A <code class='classname'>Policy</code> represents a specific exercise of authority that <span class='property'>binds</span> one or more model elements.</p>
  project:Process: <p>A <code class='classname'>Process</code> is an activity authorized by a <code class='classname'>WorkPackage</code> in support of delivering a <code class='classname'>Component</code> or producing a <code class='classname'>Product</code>. Examples include <span class='emphasis'><em>design trajectory</em></span>, <span class='emphasis'><em>conduct trade study</em></span>, and <span class='emphasis'><em>review subsystem design</em></span>.</p>
  project:Product: <p>A <code class='classname'>Product</code> is a document or other artifact supplied by a <code class='classname'>WorkPackage</code>. Example <code class='classname'>Product</code>s include trade study reports, design documents, and inspection reports.</p>
  project:Project: <p>A <code class='classname'>Project</code> is a kind of <code class='classname'>Authority</code> that <span class='property'>supplies</span> a related set of <code class='classname'>Mission</code>s in pursuit of a set of <code class='classname'>Objective</code>s.</p>
  project:Role: <p>A <code class='classname'>Role</code> corresponds to a set of assignments meant to be filled by a single <code class='classname'>Person</code>.</p>
  project:Stakeholder: <p>A <code class='classname'>Stakeholder</code> is a person or organization with a recognized interest in the successful completion of a <code class='classname'>Project</code> or <code class='classname'>Program</code>. Example <code class='classname'>Stakeholder</code>s include scientists, NASA Directorates, nuclear safety advocates, and the general public.</p>
  project:WorkPackage: <p>A <code class='classname'>WorkPackage</code> represents a discrete unit of <code class='classname'>Project</code> cost, schedule, and activity. <code class='classname'>WorkPackage</code>s form a hierarchy called the Work Breakdown Structure.</p>
  project:belongsTo: <p>A <code class='classname'>Person</code> <span class='property'>belongsTo</span> zero or more <code class='classname'>Organization</code>s.</p>
  project:binds: |-
    <p>A <code class='classname'>Policy</code>
    <em class='replaceable'><code>p</code></em>
    <span class='property'>binds</span>
    a <code class='classname'>SpecifiedElement</code>
    <em class='replaceable'><code>e</code></em>
    if and only if the course of action embodied in
    <em class='replaceable'><code>p</code></em>
    governs the design, analysis, implementation, operation, or other applicable aspects of
    <em class='replaceable'><code>e</code></em>.</p>
  project:delegatesTo: "<p>A <code class='classname'>Role</code>\n<em class='replaceable'><code>r<sub>1</sub></code></em>\n\
