  project:delivers: <p>A <code class='classname'>Process</code> <em class='replaceable'><code>p</code></em> <span class='property'>delivers</span> a <code class='classname'>Deliverable</code> <em class='replaceable'><code>r</code></em>if and only if the successful execution of <em class='replaceable'><code>p</code></em> results in availability of <em class='replaceable'><code>r</code></em>.</p>
  project:describes: |-
    <p>A <code class='classname'>Product</code>
