  project:executes: <p>An <code class='classname'>Authority</code> <em class='replaceable'><code>a</code></em> <span class='property'>executes</span> a <code class='classname'>Process</code> <em class='replaceable'><code>p</code></em> if and only if <em class='replaceable'><code>a</code></em> carries out any actions required for successful completion of <em class='replaceable'><code>p</code></em> .</p>
  project:hasAssignment: "<p>A <code class='classname'>Role</code>\n<em class='replaceable'><code>r</code></em>\n\
    <span class='property'>hasAssignment</span>\nsome <code class='classname'>AssignedElement</code>\n\
    <em class='replaceable'><code>e</code></em>\nif and only if \n<em class='replaceable'><code>r</code></em>\n\
    has specific cognizance and/or responsibility for\n<em class='replaceable'><code>e</code></em>.</p>"
  project:hasResponsibilityFor: "<p>An <code class='classname'>Organization</code>\n\
    <em class='replaceable'><code>o</code></em>\n<span class='property'>hasResponsibilityFor</span>\n\
    some <code class='classname'>Authority</code>\n<em class='replaceable'><code>a</code></em>\n\
