    \ workforce and execution of the work embodied in\n<em class='replaceable'><code>a</code></em>.\
    \ An example is the relation between a \"doing\" <code class='classname'>Organization</code>\
    \ and a <code class='classname'>WorkPackage</code>.</p>"
  project:hasRole: "<p>A <code class='classname'>Person</code>\n<em class='replaceable'><code>p</code></em>\n\
