  project:invokes: <p>A <code class='classname'>PerformedElement</code> <em class='replaceable'><code>p</code></em> <span class='property'>invokes</span> a <code class='classname'>PerformedElement</code> <em class='replaceable'><code>c</code></em> if and only if the execution of <em class='replaceable'><code>c</code></em> may be triggered or caused by and within the execution of <em class='replaceable'><code>p</code></em>.</p>
