  project:produces: <p>A <code class='classname'>WorkPackage</code> <em class='replaceable'><code>w</code></em> <span class='property'>produces</span> a <code class='classname'>Product</code> <em class='replaceable'><code>p</code></em> if and only if <em class='replaceable'><code>w</code></em> is responsible for creation and development of <em class='replaceable'><code>p</code></em>.</p>
