  project:receives: <p>A<code class='classname'>Process</code> <em class='replaceable'><code>p</code></em> <span class='property'>receives</span> a <code class='classname'>Deliverable</code> <em class='replaceable'><code>r</code></em> if and only if the successful execution of <em class='replaceable'><code>p</code></em> is contingent on the receipt of <em class='replaceable'><code>r</code></em>.</p>
  project:represents: <p>A <code class='classname'>Stakeholder</code> <em class='replaceable'><code>s</code></em> <span class='property'>represents</span> <code class='classname'>Concern</code> <em class='replaceable'><code>c</code></em> if and only if <em class='replaceable'><code>s</code></em> has a direct, legitimate, and recognized interest in <em class='replaceable'><code>c</code></em> as it relates to a particular <code class='classname'>Project</code> or <code class='classname'>Program</code>.</p>
  project:supplies: <p>A <code class='classname'>WorkPackage</code> <em class='replaceable'><code>w</code></em> <span class='property'>supplies</span> a <code class='classname'>Component</code> <em class='replaceable'><code>c</code></em> if and only if <em class='replaceable'><code>w</code></em> is responsible for the acquisition and delivery of <em class='replaceable'><code>c</code></em>.</p>
  http://imce.jpl.nasa.gov/foundation/time/time: <p>The Time Ontology defines concepts and properties for describing time.</p>
  time:Instant: <p>Conceptually, a point in time having no duration. In real life any measurement of time can only be as precise as the clock used to make the measurement. Thus, even though an instant might be expressed as a single value it cannot be assumed to identify a perfectly precise physical thing. Derived concepts should take care to specify time systems and the precise meanings of temporal relationships.</p>
  time:Interval: <p>A span of time described by a time when the interval starts and another time when it ends, where the end time must be greater than or equal to the start time (due to causality -- time only goes forward).</p>
  time:hasEnd: <p>Identifies the Instant at which an Interval ends</p>
  time:hasStart: <p>Identifies the Instant at which an Interval begins</p>
  time:precedes: <p>Expresses a temporal ordering relationship between two TemporalEntities such that the second cannot begin until the first has ended.</p>
